import styles from './Home.module.css'; // Import CSS module

const Home = () => {
    return (
        <div className={styles.container}>
            <h1 className={styles.heading}>Welcome to Cinema App</h1>
            <p className={styles.paragraph}>The most populated cinema application</p>
            <p className={styles.paragraph}>Choose a room and a film</p>
        </div>
    );
};

export default Home;
